import React from "react";

const Box = ({ value, onClick }) => {
  const style = value === "X" ? "box x" : "box o";

  return (
    <div className="p-5 text-lg font-bold leading-normal text-center text-black bg-white border-none rounded-md shadow-2xl hover:bg-transparent focus:outline-none focus:ring ">
      <button className={style} onClick={onClick}>
        {value}
      </button>
    </div>
  );
};

export default Box;
